ns4:addRequirement.ns4:content:
Наличие у участника закупки одного из следующих видов опытаопытов выполнения работ:
1) опыт исполнения договора строительного подряда, предусматривающего выполнение работ по строительству, реконструкции особо опасного, технически сложного, уникального объекта капитального строительства;
2) опыт выполнения участником закупки, являющимся застройщиком, работ по строительству, реконструкции особо опасного, технически сложного, уникального объекта капитального строительства.
Цена выполненных работ по договору, предусмотренному пунктом 1 настоящей графы настоящей позиции, цена выполненных работ, предусмотренных пунктом 2 настоящей графы настоящей позиции, должна составлять не менее 20 процентов от начальной (максимальной) цены контракта, заключаемого по результатам определения поставщика (подрядчика, исполнителя).Информация и документы, подтверждающие соответствие участников закупки дополнительным требованиям:
в случае наличия опыта, предусмотренного пунктом 1 дополнительного требования настоящей позиции:
1) исполненный договор;
2) акт приемки объекта капитального строительства, а также акт выполненных работ, подтверждающий цену выполненных работ, если акт приемки объекта капитального строительства не содержит цену выполненных работ;
3) разрешение на ввод объекта капитального строительства в эксплуатацию (за исключением случая, если работы, являющиеся объектом закупки, не требуют в соответствии с законодательством о градостроительной деятельности выдачи разрешения на ввод объекта капитального строительства в эксплуатацию и при этом договор, предусмотренный абзацем вторым настоящей графы, предусматривает выполнение работ, не требующих в соответствии с указанным законодательством выдачи такого разрешения)случаев, при которых такое разрешение не выдается в соответствии с законодательством о градостроительной деятельности) или решение о технической готовности линейного объекта инфраструктуры к временной эксплуатации.
В случае наличия опыта, предусмотренного пунктом 2 дополнительного требования настоящей позиции:
1) раздел 11 "Смета на строительство, реконструкцию, капитальный ремонт, снос объекта  объектов капитального строительства" проектной документации;
2) разрешение на ввод объекта капитального строительства в эксплуатацию или решение о технической готовности линейного объекта инфраструктуры к временной эксплуатации
